import React from 'react'
import './TestMessage.css'
import requestToServer from '../../requestToServer/requestToServer'

export default function TestMessage() {

    const [requestData, setRequestData] = React.useState([null])
    React.useEffect(() => {
        const data = requestToServer('/api/test-message')
            .then(d => {
                setRequestData(d.data);
            })
    }, [])

    const requestDataElements = requestData !== null

    return (
        <div className='test--message--cont'>
            <h2>
                {requestData[0].TestMessage}
            </h2>
        </div>
    )
}
